package com.study.leetcode.dynamicprogramming.easy;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class IsSubsequenceTest {
  @Test
  void test1() {
    final IsSubsequence isSubsequence = new IsSubsequence();

    String s = "abc";
    String t = "ahbgdc";

    boolean expected = true;

    Assertions.assertEquals(expected, isSubsequence.isSubsequence(s, t));
  }

  @Test
  void test2() {
    final IsSubsequence isSubsequence = new IsSubsequence();

    String s = "axc";
    String t = "ahbgdc";

    boolean expected = false;

    Assertions.assertEquals(expected, isSubsequence.isSubsequence(s, t));
  }

  @Test
  void test3() {
    final IsSubsequence isSubsequence = new IsSubsequence();

    String s = "acd";
    String t = "ahbgdc";

    boolean expected = false;

    Assertions.assertEquals(expected, isSubsequence.isSubsequence(s, t));
  }

  @Test
  void test4() {
    final IsSubsequence isSubsequence = new IsSubsequence();

    String s = "leeeeetcode";
    String t =
        "";

    boolean expected = true;

    Assertions.assertEquals(expected, isSubsequence.isSubsequence(s, t));
  }
}
